import React, { FC, ReactElement } from "react";
import { ITodo } from "../typings";

interface IProps {
    todoLits: ITodo;
    toggleTodo: (id: number) => void;
    removeTodo: (id: number) => void;
}


const TdList:FC<IProps> = ({
    todoList
}):ReactElement => {
    return (
        <div className="todo-list"></div>
    )
}

export default TdList
